const before = require('@xuelin/dev-proxy/lib/before');
const middleware = require('@xuelin/dev-proxy/lib/middlewares');

// umi
{
  devServer: {
    beforeMiddlewares:[middleware]
  }
}

// webpack 4
{
  devServer: {
    before
  }
}
// webpack 5

{
  devServer: {
    setupMiddlewares(_, devServer) {
      before(devServer.app);
    },
  }
}

// proxyConfig.js
export default {
  baseUrl: 'https://192.168.31.143',
  prefix: '/catalog-mng',
  port: '8443',
  proxy: {
    '/api': {
      target: '\${baseUrl}:\${port}',
      changeOrigin: true,
      secure: false,
    },
    '/mng': {
      changeOrigin: true,
      secure: false,
      target: '\${baseUrl}:\${port}',
    },
    '/catalog-mng/mng': {
      changeOrigin: true,
      secure: false,
      target: '\${baseUrl}:\${port}',
      pathRewrite: { '^/catalog-mng/mng': '\${prefix}/mng' },
    },
  },
}

// \u5165\u53E3\u6587\u4EF6
import proxyConfig from '../proxyConfig';

if (process.env.NODE_ENV === 'development') {
    require('@xuelin/dev-proxy').default(proxyConfig);
}
